// SPDX-License-Identifier: MIT

pragma solidity 0.8.7; 


import "./Engine.sol";

contract Game is Engine{

    uint randNonce = 0;
    uint bitsresult;

    //I first create the function for random number generation 
    function randNB(uint _modulus) internal returns(uint){
    randNonce++; 
    return uint(keccak256(abi.encodePacked(block.timestamp, msg.sender,randNonce))) % _modulus;
    }

    //We build the actual game function 
    function gameResults(uint userInput) public returns(uint nb1, uint nb2, bool result){
    //Nb1 and Nb2 take a random number between 0 and 100
    nb1 = randNB(100);
    nb2 = randNB(100);
    //We call function from "operator" contract in Engine file
    bitsresult = bitsoper(nb1, nb2);
    if (bitsresult == userInput){
                result = true;
            } else {
                result = false;
            }  
    }  
}

